import React from "react";
import { useState } from "react";
import {Navigate, useNavigate} from "react-router-dom";
import ProjectCard from "./ProjectCard";
import CreateNewTabForm from "./CreateNewTabForm";


function UserProjects({user, userTabs, setProjectToView}){
    const navigate = useNavigate()
    const projectsToDisplay = userTabs ? userTabs.map((tab) => {
        return <ProjectCard key={tab.id} user={user} tab={tab} setProjectToView={setProjectToView}/>
    }) : null

    return (
        <div className='h-auto mx-auto flex flex-col items-center border rounded-md mb-10 mt-10 flex-grow'>
        <h1 className="text-4xl md:text-6xl mb-4 ml-2 mt-2">Your Projects</h1>
        <div className="m-2 max-w-full md:m-4 gap-4 grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4">
            {projectsToDisplay}
        </div>
    </div>
    )
}

export default UserProjects
